import React from "react";

import ImgIntro from "../../components/ImgIntro.jsx";
import {
  adidaslogo,
  nblogo,
  nikelogo,
  sketcherslogo,
} from "../../assets/index.js";

import "./Styles/styles.css";

const Landing = () => {
  return (
    <div className="container">
      <p>DISCOVER LIMITED SNEAKERS WITHOUT LIMITATION</p>
      <div className="content">
        <div className="img-content">
          <ImgIntro
            src={
              "https://img.modivo.cloud/product(9/2/6/b/926b76ccf2a4888a9261bc36570dec672931fde8_01_0000301902560_rz.jpg,webp)/new-balance-snikerci-pv574nd1-cinii.webp"
            }
            logo={nblogo}
          />
          <ImgIntro
            src={
              "https://img.modivo.cloud/product(3/1/3/6/3136fefea9558ba5f811971eefef2abb9670e415_01_0000302994076_pl.jpg,webp)/nike-vzuttia-terminator-high-fd0650-100-bilii-0000302994076.webp"
            }
            logo={nikelogo}
          />
          <ImgIntro
            src={
              "https://img.modivo.cloud/product(b/4/1/a/b41a8ff8419c3c97e8e5e27f33e1da5a7b127507_01_0000301554363_rz.jpg,webp)/adidas-vzuttia-gazelle-shoes-hp2879-chervonii.webp"
            }
            logo={adidaslogo}
          />
          <ImgIntro
            src={
              "https://img.modivo.cloud/product(c/7/4/3/c743e57a116ad8d50604cb32f0994647068b06b2_01_0000300592458_rz.jpg,webp)/skechers-snikerci-zigzag-swagger-117188-wtn-bezhevii.webp"
            }
            logo={sketcherslogo}
          />
        </div>
        <div className="text-content"></div>
      </div>
      <div className="footer"></div>
    </div>
  );
};

export default Landing;

